document.addEventListener("DOMContentLoaded",function(){window.dataLayer=window.dataLayer||[]
function gtag(){dataLayer.push(arguments)}
if(document.forms.search){var query=document.forms.search.query
query.addEventListener("blur",function(){if(this.value)gtag("event","search",{search_term:this.value})})}
document$.subscribe(function(){var feedback=document.forms.feedback
if(typeof feedback==="undefined")return
for(var button of feedback.querySelectorAll("[type=submit]")){button.addEventListener("click",function(ev){ev.preventDefault()
var page=document.location.pathname
var data=this.getAttribute("data-md-value")
gtag("event","feedback",{page,data})
feedback.firstElementChild.disabled=true
var note=feedback.querySelector(".md-feedback__note [data-md-value='"+data+"']")
if(note)note.hidden=false})
feedback.hidden=false}})
var last_pathname=document.location.pathname
location$.subscribe(function(url){if(last_pathname==url.pathname)return
last_pathname=url.pathname
if(typeof zaraz=="undefined")return
if(typeof zarazData=="undefined")return
zarazData.l=document.location.href
zarazData.t=document.title
zaraz.pageVariables={}
zaraz.track("__zarazSPA")})})